import React from 'react';
import { Center, Text,StyleSheet } from 'native-base';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import HomeScreen from '../Screens/HomeScreen';
import Colors from '../color';

const Tab = createBottomTabNavigator();
const customTab = ({children, onPress}) => (<Text>haha</Text>)

function BottomNav() {
  return (
    <Tab.Navigator backBehavior="main" initialRouteName='Main' screenOptions={{
        tabBarShowLabel: false,
        tabBarStyle:{...styles.tab},
        headerShown: false,
        tabBarHideOnKeyboard: true 
    }}>
        <Tab.Screen name="Main" component={HomeScreen} options={{
            tabBarIcon:({focused}) => (
                <Center>
                    {focused ? (
                        <Entypo name="home" size={24} color={Colors.main} />
                    ) : (
                        <AntDesign name="home" size={24} color={Colors.black} />
                    )}
                </Center>
            )
        }}/>
    </Tab.Navigator>
  );
}

const styles = StyleSheet.create({
    tab:{
        elev
    }
})

export default BottomNav;
